  private Sort(list: any, value: string): [] {
    return list.sort((a, b) => {
      let one = a[value].toLowerCase();
      let two = b[value].toLowerCase();
      if ( one > two ) {return 1;}
      else if ( one < two ) {return -1}
      else return 0;
    });
  }
