  public FindInstitution(InstitutionId: string) : Observable<IInstitution | undefined> {
    return this.Institution$
      .pipe(
        map((InstitutionMap: IInstitution[]) => {
          if (InstitutionMap != null && InstitutionMap.length) {
            return InstitutionMap.find((InstitutionFilter: IInstitution) => InstitutionFilter.Id == InstitutionId);
          }
        })
      );
  };

  public CreateInstitution(NewInstitution : IInstitution) : Observable<IConfirm> {
    return this.Http.post<IConfirm>(this.BaseUrl + "/POST/230/Create", NewInstitution);
  }


